import "../assets/sass/components/component-container/text-box-container.scss";
import React from "react";

function TextBoxContainer() {
  return (
    <div className="text-box-container">
      <span id="text-box-message">{}asf;jasf</span>
      <span id="text-box-from"></span>
      <span id="text-box-date"></span>
    </div>
  );
}

export default TextBoxContainer;
